    return (
        <ResponsiveContainer width="100%" height="80%">
            <LineChart data={props.data} margin={{right: 20}}>
                <Legend verticalAlign="top" height={36}/>
                <Line type="monotone" dataKey="purchases" stroke="#8884d8" />
                <Line type="monotone" dataKey="purchases" stroke="red" />
                <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
                <XAxis dataKey="date" />
                <YAxis dataKey="purchases"/>
                <Tooltip />
            </LineChart>
        </ResponsiveContainer>
    )
}
